import React from 'react';
import { withStyles } from '@material-ui/core/styles';
import Link from '../../Components/LowerCaseUrlLink';

const styles = {
  root: {
    background: '#fff',
    border: 0,
    height: 48,
    display: 'flex'
  },
  menu: {
    display: 'flex',
    listStyle: 'none'
  },
  menuItem: {
    textDecoration: 'none'
  }
};


const TopNav = props => {
  const { classes } = props;

  const menuItems = [
    {
      label: 'Life Insurance',
      href: `/${props.language}/life-insurance}`
    },
    {
      label: 'Health Insurance',
      href: `/${props.language}/health-insurance}`
    },
    {
      label: 'Pensions',
      href: `/${props.language}/pensions}`
    },
    {
      label: 'Investments',
      href: `/${props.language}/investments}`
    },
  ];

  return (
    <nav>
        <ul className={classes.menu}>
          {menuItems.map(({ label, href }) =>
            // <Link className={classes.menuItem} key={href} to={href}>
            //     {label}
            // </Link>
            <li key={href}>
              <a className={classes.menuItem} href={href}>{label}</a>
            </li>
          )}
        </ul>
    </nav>
  );
};

// export default translate('Header')(Header);

export default withStyles(styles)(TopNav);
